    return {
      list: []
    }
  },
  mutations: {
    upDateList (state, newList) {
      state.list = newList
    }
  },
  actions: {
    async  getList (context) {
      const result = axios.get('http://localhost:3000/cart')
      context.cpmmit('upDateList')
    }
